        if isinstance(a, (int, float)) and isinstance(b, (int, float)):
            return a if a > b else b
        else:
            return a if float(a.replace(',', '.')) > float(b.replace(',', '.')) else b
    else:
        if a == b:
            return None
        return a if a > b else b

