def intersection(interval1, interval2):
    start1, end1 = interval1
    start2, end2 = interval2

    start1, end1 = min(start1, end1), max(start1, end1)
    start2, end2 = min(start2, end2), max(start2, end2)

    intersection_start = max(start1, start2)
    intersection_end = min(end1, end2)

    intersection_length = max(0, intersection_end - intersection_start + 1)

    if intersection_length <= 1:
        return "NO"

    if is_prime(intersection_length):
        return "YES"
    else:
        return "NO"

def minPath(grid, k):
    n = len(grid)
    m = len(grid[0])
    visited = [[False for _ in range(m)] for _ in range(n)]

    def dfs(i, j, path):
        if i < 0 or i >= n or j < 0 or j >= m or visited[i][j]:
            return
        path.append(grid[i][j])
        visited[i][j] = True
        if len(path) == k:
            return path.copy()
        res = []
        for x, y in [(i+1, j), (i-1, j), (i, j+1), (i, j-1)]:
            res.append(dfs(x, y, path))
        visited[i][j] = False
        return min(filter(None, res))

    for i in range(n):
        for j in range(m):
            path = dfs(i, j, [])
            if path:
                return path

