    for i in range(1, n+1):
        factorial = 1
        for j in range(1, i+1):
            factorial *= j
        result *= factorial
    return result

def file_name_check(file_name):
    if file_name.count('.') != 1:
        return 'No'
    name, ext = file_name.split('.')
    if not name or not name[0].isalpha():
        return 'No'
    if ext not in ['txt', 'exe', 'dll']:
        return 'No'
    if sum(c.isdigit() for c in file_name) > 3:
        return 'No'
    return 'Yes'

def bf(planet1, planet2):
    planets = ["Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"]
    if planet1 not in planets or planet2 not in planets:
        return ()
    start_index = planets.index(planet1)
    end_index = planets.index(planet2)
    if start_index > end_index:
        start_index, end_index = end_index, start_index
    return tuple(planets[start_index+1:end_index])

def prod_signs(arr):
    if not arr:
        return None
    product = 1
    for num in arr:
        if num == 0:
            return 0
        product *= num / abs(num)
    return sum(abs(num) for num in arr) * product

def digits(n):
    product = 1
    has_odd_digit = False
    for digit in str(n):
        if int(digit) % 2 != 0:
            product *= int(digit)
            has_odd_digit = True
    return product if has_odd_digit else 0

def histogram(test):
    if not test:
        return {}

    letters = test.split()
    letter_count = {}
    for letter in letters:
        if letter in letter_count:
            letter_count[letter] += 1
        else:
            letter_count[letter] = 1
    max_count = max(letter_count.values())
    return {letter: count for letter, count in letter_count.items() if count == max_count}

def tri(n):
    if n == 0:
        return [1]
    elif n == 1:
        return [1, 3]
    else:
        tribonacci = [1, 3]
        for i in range(2, n + 1):
            if i % 2 == 0:
                tribonacci.append(1 + i // 2)
            else:
                tribonacci.append(tribonacci[i - 1] + tribonacci[i - 2] + tribonacci[i - 3])
        return tribonacci

def match_parens(lst):
    stack = []
    for s in lst:
        for char in s:
            if char == '(':
                stack.append(char)
            else:
                if not stack or stack[-1] != '(':
                    return 'No'
                stack.pop()
    return 'Yes'

