        a = a.replace(',', '.')
    if isinstance(b, str):
        b = b.replace(',', '.')

    a = float(a) if isinstance(a, str) else a
    b = float(b) if isinstance(b, str) else b

    if a == b:
        return None
    elif type(a) == type(b):
        return max(a, b)
    else:
