import math

def intersection(interval1, interval2):
    start1, end1 = interval1
    start2, end2 = interval2

    start1, end1 = min(start1, end1), max(start1, end1)
    start2, end2 = min(start2, end2), max(start2, end2)

    intersection_start = max(start1, start2)
    intersection_end = min(end1, end2)

    if intersection_start > intersection_end:
        return "NO"

    intersection_length = intersection_end - intersection_start + 1

    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(math.sqrt(n)) + 1):
            if n % i == 0:
                return False
        return True

    return "YES" if is_prime(intersection_length) else "NO"

def get_max_triples(n):
    count = 0
    for i in range(1, n+1):
        a_i = i * i - i + 1
        for j in range(i+1, n+1):
            a_j = j * j - j + 1
            for k in range(j+1, n+1):
                a_k = k * k - k + 1
                if (a_i + a_j + a_k) % 3 == 0:
                    count += 1
    return count

def minPath(grid, k):
    n = len(grid)
    m = len(grid[0])
    visited = [[False for _ in range(m)] for _ in range(n)]

    def dfs(i, j, path):
        if i < 0 or i >= n or j < 0 or j >= m or visited[i][j]:
            return
        path.append(grid[i][j])
        visited[i][j] = True
        if len(path) == k:
            return path.copy()
        res = []
        for x, y in [(i+1, j), (i-1, j), (i, j+1), (i, j-1)]:
            res.append(dfs(x, y, path))
        visited[i][j] = False
        valid_paths = list(filter(None, res))
        return min(valid_paths, key=lambda x: x) if valid_paths else None

    for i in range(n):
        for j in range(m):
            path = dfs(i, j, [])
            if path:
                return path
    return None

