def encrypt(s):
    result = ""
    for char in s:
        if char.isalpha():
            shift = (ord(char) - ord('a') + 2) * 2
            if char.islower():
                result += chr((ord('a') + (shift % 26)) % 26 + ord('a'))
            else:
                result += chr((ord('A') + (shift % 26)) % 26 + ord('A'))
        else:
            result += char
    return result

def largest_prime_sum(lst):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    def sum_of_digits(n):
        return sum(int(digit) for digit in str(n))

    prime_numbers = [num for num in lst if is_prime(num)]
    if not prime_numbers:
        return 0
    largest_prime = max(prime_numbers)
    return sum_of_digits(largest_prime)

def encode(message):
    encoded_message = ''
    vowels = 'aeiouAEIOU'
    for char in message:
        if char.isalpha():
            if char.lower() in vowels:
                encoded_char = chr((ord(char) - ord('a') + 2) % 26 + ord('A') if char.islower() else (ord(char) - ord('A') + 2) % 26 + ord('A'))
                encoded_message += encoded_char
            else:
                encoded_message += char.swapcase()
        else:
            encoded_message += char
    return encoded_message

