            has_odd_digit = True
    return product if has_odd_digit else 0

def prod_signs(arr):
    if not arr:
        return None
    product = 1
    has_zero = False
    for num in arr:
        if num == 0:
            has_zero = True
        else:
            product *= num / abs(num)
    if has_zero:
        return 0
    return sum(abs(num) for num in arr) * product

