    for char in s:
        if char.isalpha():
            shift = (ord(char) - ord('a') + 2) * 2
            if char.islower():
                result += chr((ord('a') + (shift % 26)) % 26 + ord('a'))
            else:
                result += chr((ord('A') + (shift % 26)) % 26 + ord('A'))
        else:
            result += char
    return result

