    vowels = 'aeiouAEIOU'
    for char in message:
        if char.isalpha():
            if char.lower() in vowels:
                encoded_char = chr((ord(char) - ord('a') + 2) % 26 + ord('A') if char.islower() else (ord(char) - ord('A') + 2) % 26 + ord('A'))
