        a_i = i * i - i + 1
        for j in range(i+1, n+1):
            a_j = j * j - j + 1
            for k in range(j+1, n+1):
                a_k = k * k - k + 1
                if (a_i + a_j + a_k) % 3 == 0:
                    count += 1
    return count

def minPath(grid, k):
    n = len(grid)
    m = len(grid[0])
    visited = [[False for _ in range(m)] for _ in range(n)]

    def dfs(i, j, path):
        if i < 0 or i >= n or j < 0 or j >= m or visited[i][j]:
            return
        path.append(grid[i][j])
        visited[i][j] = True
        if len(path) == k:
            return path
        res = []
        for x, y in [(i+1, j), (i-1, j), (i, j+1), (i, j-1)]:
            temp = dfs(x, y, path)
            if temp:
                res.append(temp)
        visited[i][j] = False
        if res:
            return min(res)

    for i in range(n):
        for j in range(m):
            path = dfs(i, j, [])
            if path and len(path) == k:
                return path

